import React from 'react';

const Music = (props) => {

		const dataLocal = props.dataLocal

		const content = (dataLocal.title)

		const display = (
				<div>
				<div className='infoCategory'>
				{dataLocal.category}
				</div>
				<div className='infoTitle'>
				{dataLocal.title}
				</div>
				<div className='Content'>
				</div>
				</div>
		)

		return (
				<div>
						{display}
				</div>
		)
}
export default Music;
